--
-- Name: mark_insert_time(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION mark_insert_time() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    NEW.received_timestamp = now();
    RETURN NEW;	
END;
$$;


ALTER FUNCTION public.mark_insert_time() OWNER TO postgres;

--
-- Name: mark_last_record(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION mark_last_record() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
	-- NEW = new entry on table record
BEGIN
	-- set last_record
    update sensor
	set last_record = NEW.record_id
	where sensor.sensor_id=NEW.sensor_id;
	RETURN NEW;
END;
$$;


ALTER FUNCTION public.mark_last_record() OWNER TO postgres;

